import React from 'react';

function AboutMe() {
  return (
    <section className="about-me">
      <h2>About Me</h2>
      <p>
        I am a passionate and creative individual with a strong background in
        (insert your field). I am skilled in (list your skills) and always
        eager to learn new things. I am currently (describe your current
        position or goals).
      </p>
    </section>
  );
}

export default AboutMe;
